import React, { useState } from 'react';

const Result = ({ cells }) => {
        console.log(cells);
        if (cells[0, 1, 2] === ['X', 'X', 'X']) {
            return 'X';
        } else if (cells[0, 1, 2] === ['O', 'O', 'O']) {
            return 'O';
        } else {
            return 'N/A';
        }
}

export default Result;
